import React, { useEffect } from "react";
import { parse } from "qs";

const App = () => {
  useEffect(() => {
    let data = [
      { pseudo: "Denis", age: 33, techno: ["Javascript", "php", "Ruby"] },
      { pseudo: "Moussa", age: 23, techno: ["python", "nodejS", "MongoDb"] },
      { pseudo: "Isaac", age: 2, techno: ["java", "c++", "c"], admin: true }
    ];
    document.body.innerHTML += data
      .filter(user => user.admin === false)
      .sort((a, b) => b.pseudo - a.pseudo)
      .map(
        ok => ` <div className="user-card" >
      <h1> ${ok.pseudo}</h1>
      <p>Age: ${ok.age}</p>
      <p>Status : ${ok.admin ? "Tu es admin" : "non pas admin"}</p>


      </div>`
      )
      .join(" ");
  });

  return <></>;
};

export default App;
